export default function InfoCard() {

  return (
    <div className="info-card-main">
      <h3 className="info-fullname">Eren Kurt</h3>
      <p className="info-status">Durum: <span className="info-status-sub">Bilinmiyor</span></p>
      <p className="info-description">Aciklama</p>
      <p className="info-address"><span className="info-address-district">Karsiyaka Mahallesi</span> Daire 15 Cinar Apartmani No 34</p>
      <p>Tel: <span className="info-tel">0545 567 98 76</span></p>
      <p className="info-city">Ankara / Cankaya</p>
    </div>
  )
}
